import React, { Component } from 'react'

export default class ViewProjectBugs extends Component {
    constructor(props) {
        super(props);

        this.state = {
            bugsList: [],

        }
    }

    componentDidMount() {
        axios.get('http://localhost:4000/bugs/')
            .then(response => {
                this.setState({
                    bugsList: response.data});

            })
            .catch(function(error) {
                console.log(error)
            })
    }

    render() {
        return (
            <div>
                <h3>View Project Bugs here</h3>
            </div>  
        )
    }
}
